import sys
from collections import defaultdict

def find_clique_or_independent_set(n, m, friendships):
    # Create adjacency list for the graph
    graph = defaultdict(set)
    for u, v in friendships:
        graph[u].add(v)
        graph[v].add(u)

    # Check for a clique of size 5
    def find_clique():
        for node in range(1, n + 1):
            neighbors = graph[node]
            if len(neighbors) >= 4:
                for a in neighbors:
                    for b in neighbors:
                        if a != b and b in graph[a]:
                            for c in neighbors:
                                if c != a and c != b and c in graph[a] and c in graph[b]:
                                    for d in neighbors:
                                        if d != a and d != b and d != c and d in graph[a] and d in graph[b] and d in graph[c]:
                                            return [node, a, b, c, d]
        return None

    # Check for an independent set of size 5
    def find_independent_set():
        all_nodes = set(range(1, n + 1))
        for node in range(1, n + 1):
            non_neighbors = all_nodes - graph[node] - {node}
            if len(non_neighbors) >= 4:
                non_neighbors = list(non_neighbors)
                return [node] + non_neighbors[:4]
        return None

    clique = find_clique()
    if clique:
        return clique

    independent_set = find_independent_set()
    if independent_set:
        return independent_set

    return -1

def main():
    input = sys.stdin.read
    data = input().split()

    n = int(data[0])
    m = int(data[1])
    friendships = []

    index = 2
    for _ in range(m):
        u = int(data[index])
        v = int(data[index + 1])
        friendships.append((u, v))
        index += 2

    result = find_clique_or_independent_set(n, m, friendships)

    if result == -1:
        print(result)
    else:
        print(" ".join(map(str, result)))

if __name__ == "__main__":
    main()

main()

