    data = input().split()

    N = int(data[0])
    M = int(data[1])

    friendships = []
    index = 2
    for _ in range(M):
        U = int(data[index])
        V = int(data[index + 1])
        friendships.append((U, V))
        index += 2

    # Create an adjacency set for each person
    friends = {i: set() for i in range(1, N + 1)}
    for u, v in friendships:
        friends[u].add(v)
        friends[v].add(u)

    # Check all combinations of 5 people
    for combination in itertools.combinations(range(1, N + 1), 5):
        all_friends = True
        no_friends = True

        # Check if all are friends or none are friends
        for i in range(5):
            for j in range(i + 1, 5):
                if combination[j] in friends[combination[i]]:
                    no_friends = False
                else:
                    all_friends = False

        if all_friends or no_friends:
            print(" ".join(map(str, combination)))
            return

    print(-1)

if __name__ == "__main__":
